import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Login from './components/Login/Login'; // Your Login component path
import Home from './components/Home/Home'; // Your Home component path

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Route for Login */}
        <Route path="/" element={<Login />} />

        {/* Route for Home, redirect to Login if not logged in */}
        <Route path="/home" element={<Home />} />
      </Routes>
    </Router>
  );
};

export default App;
